import React from "react";
import "./Card.css";

const Card = ({ slide }) => {
  return (
    <div className="container">
      <div className="front side">
        <div className="content">
          <h1 className="cardTitle">{slide.title}</h1>
          <img src={slide.img}></img>
        </div>
      </div>
      <div className="back side">
        <div className="content">
          <p>{slide.description}</p>
        </div>
      </div>
    </div>
  );
};
export default Card;
